import React from "react";
import axios from "axios";
import "./App.css";

const API_KEY = process.env.REACT_APP_API_KEY;
export default class App extends React.Component {
  state = { restaurants: [] };

  componentDidMount() {
    axios
      .get(
        "https://cors-anywhere-hclaunch.herokuapp.com//https://maps.googleapis.com/maps/api/place/textsearch/json?query=restaurants+in+Charlottesville&opennow&key=" +
        API_KEY
      )
      .then(res => {
        var restaurants = res.data.results;
        console.log(restaurants);

        this.setState({
          restaurants: restaurants
        });
        console.log(this.state);
      });
  }
  render() {
    return (
      <div>
        <ul>
          {this.state.restaurants.map(restaurant => (
            <div>
              <li key={restaurant.id}>
                <li>{restaurant.name}
                  <ul>
                    <li>{restaurant.formatted_address}</li>
                    <ul> restaurant.plus_code.price_level</ul>
                    <ul> restaurant.plus_code.rating</ul>

                  </ul>

                </li>

              </li>

            </div>
          ))}

        </ul>


      </div>

    )

  }


}
